import{_ as a}from"./chunks/v5_nano_01.DMHbymF9.js";import{_ as o,a as r,b as l,c as i,d as e,e as n,f as s}from"./chunks/v5_nano_pinouts.TtGHIgB6.js";import{_ as c,c as d,a8 as h,o as p}from"./chunks/framework.BDnHobkS.js";const P=JSON.parse('{"title":"CUAV V5 nano 배선 빠른 시작","description":"","frontmatter":{},"headers":[],"relativePath":"ko/assembly/quick_start_cuav_v5_nano.md","filePath":"ko/assembly/quick_start_cuav_v5_nano.md"}'),u={name:"ko/assembly/quick_start_cuav_v5_nano.md"};function m(f,t,g,_,b,y){return p(),d("div",null,t[0]||(t[0]=[h('<h1 id="cuav-v5-nano-배선-빠른-시작" tabindex="-1">CUAV V5 nano 배선 빠른 시작 <a class="header-anchor" href="#cuav-v5-nano-배선-빠른-시작" aria-label="Permalink to &quot;CUAV V5 nano 배선 빠른 시작&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>This quick start guide shows how to power the <a href="./../flight_controller/cuav_v5_nano.html">CUAV V5 nano</a> flight controller and connect its most important peripherals.</p><p><img src="'+a+'" alt="Nano Hero Image"></p><h2 id="배선-개요" tabindex="-1">배선 개요 <a class="header-anchor" href="#배선-개요" aria-label="Permalink to &quot;배선 개요&quot;">​</a></h2><p>아래의 이미지는 주요 센서와 주변 장치(모터 및 서보 출력 제외)들의 연결 방법을 설명합니다. 다음 섹션에서 각 장치에 대하여 자세히 설명합니다.</p><p><img src="'+o+'" alt="quickstart"></p><table tabindex="0"><thead><tr><th style="text-align:left;">인터페이스</th><th style="text-align:left;">기능</th></tr></thead><tbody><tr><td style="text-align:left;">전원</td><td style="text-align:left;">전원 모듈을 연결하십시오. 전력 및 ANALOG 전압 및 전류 측정을 제공합니다.</td></tr><tr><td style="text-align:left;">PM2</td><td style="text-align:left;"><a href="./../flight_controller/cuav_v5_nano.html#compatibility_pm2">Do not use with PX4</a></td></tr><tr><td style="text-align:left;">TF CARD</td><td style="text-align:left;">로그 저장용 SD 카드 (카드와 함께 제공)</td></tr><tr><td style="text-align:left;">M1~M8</td><td style="text-align:left;">PWM 출력 모터와 서보를 콘트롤 합니다.</td></tr><tr><td style="text-align:left;">A1~A3</td><td style="text-align:left;">Capture pins (not <em>currently</em> supported on PX4).</td></tr><tr><td style="text-align:left;">nARMED</td><td style="text-align:left;">FMU 시동 상태를 나타냅니다. 액티브 로우 (시동시 낮음)입니다.</td></tr><tr><td style="text-align:left;">DSU7</td><td style="text-align:left;">FMU 디버그에 사용되며 디버그 정보를 획득합니다.</td></tr><tr><td style="text-align:left;">I2C2/I2C3/I2C4</td><td style="text-align:left;">외부 나침반과 같은 I2C 장치를 연결합니다.</td></tr><tr><td style="text-align:left;">CAN1/CAN2</td><td style="text-align:left;">CAN GPS와 같은 UAVCAN 장치를 연결합니다.</td></tr><tr><td style="text-align:left;">TYPE-C(USB)</td><td style="text-align:left;">펌웨어 업로드 등의 작업시에 비행 콘트롤러와 컴퓨터를 연결합니다.</td></tr><tr><td style="text-align:left;">GPS&amp;SAFETY</td><td style="text-align:left;">GPS, 안전 스위치 및 부저가 포함된 Neo GPS에 연결합니다.</td></tr><tr><td style="text-align:left;">TELEM1/TELEM2</td><td style="text-align:left;">텔레메트리에 연결합니다.</td></tr><tr><td style="text-align:left;">DSM/SBUS/RSSI</td><td style="text-align:left;">DSM, SBUS, RSSI 신호 입력 인터페이스, DSM 인터페이스는 DSM 위성 수신기에 연결 가능, SBUS 인터페이스는 SBUS 원격 제어 수신기에 연결 가능, 신호 강도 반환 모듈용 RSSI 포함.</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>For more interface information, please read <a href="http://manual.cuav.net/V5-nano.pdf" target="_blank" rel="noreferrer">V5 nano Manual</a>.</p></div><p><img src="'+r+'" alt="quickstart"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If the controller cannot be mounted in the recommended/default orientation (e.g. due to space constraints) you will need to configure the autopilot software with the orientation that you actually used: <a href="./../gps_compass/rtk_gps.html">Flight Controller Orientation</a>.</p></div><h2 id="gps-나침반-안전-스위치-led" tabindex="-1">GPS + 나침반 + 안전 스위치 + LED <a class="header-anchor" href="#gps-나침반-안전-스위치-led" aria-label="Permalink to &quot;GPS + 나침반 + 안전 스위치 + LED&quot;">​</a></h2><p>The recommended GPS module is the <em>Neo v2 GPS</em>, which contains GPS, compass, safety switch, buzzer, LED status light.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Other GPS modules may not work (see <a href="./../flight_controller/cuav_v5_nano.html#compatibility_gps">this compatibility issue</a>).</p></div><p>The GPS/Compass module should be <a href="./../assembly/mount_gps_compass.html">mounted on the frame</a> as far away from other electronics as possible, with the direction marker towards the front of the vehicle (Neo GPS arrow is in the same direction as the flight control arrow). 케이블을 사용하여 비행 제어 GPS에 연결합니다.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If you use CAN GPS, please use the cable to connect to the flight control CAN interface.</p></div><p><img src="'+l+'" alt="quickstart"></p><h2 id="안전-스위치" tabindex="-1">안전 스위치 <a class="header-anchor" href="#안전-스위치" aria-label="Permalink to &quot;안전 스위치&quot;">​</a></h2><p>The dedicated safety switch that comes with the V5+ is only required if you are not using the recommended <em>Neo v2 GPS</em> (which has an inbuilt safety switch).</p><p>If you are flying without the GPS you must attach the switch directly to the <code>GPS1</code> port in order to be able to arm the vehicle and fly (If you use the old 6-pin GPS, please read the definition of the bottom interface to change the line).</p><h2 id="부저" tabindex="-1">부저 <a class="header-anchor" href="#부저" aria-label="Permalink to &quot;부저&quot;">​</a></h2><p>If you do not use the recommended <em>Neo v2 GPS</em> the buzzer may not work.</p><h2 id="무선-조종" tabindex="-1">무선 조종 <a class="header-anchor" href="#무선-조종" aria-label="Permalink to &quot;무선 조종&quot;">​</a></h2><p>차량을 수동 제어에는 무선 조종기가 필요합니다. PX4의 자율 비행은 무선조종기가 필수 사항은 아닙니다. 기체와 조종자가 통신하기 위하여 송신기와 수신기를 바인딩하여야 합니다. 송신기와 수신기의 매뉴얼을 참고하십시오.</p><p>아래 그림은 원격 수신기에 액세스하는 방법을 보여줍니다 (키트에서 S.BUS 케이블을 찾으십시오)</p><p><img src="'+i+'" alt="quickstart"></p><h2 id="spektrum-satellite-수신기" tabindex="-1">Spektrum Satellite 수신기 <a class="header-anchor" href="#spektrum-satellite-수신기" aria-label="Permalink to &quot;Spektrum Satellite 수신기&quot;">​</a></h2><p>V5 nano에는 전용 DSM 케이블이 있습니다. If using a Spektrum satellite receiver, this should be connected to the flight controller <code>DSM/SBUS/RSSI</code> interface.</p><h2 id="전원" tabindex="-1">전원 <a class="header-anchor" href="#전원" aria-label="Permalink to &quot;전원&quot;">​</a></h2><p>The <em>v5 nano</em> kit includes the <em>HV_PM</em> module, which supports 2~14S LiPo batteries. Connect the 6pin connector of the <em>HW_PM</em> module to the flight control <code>Power</code> interface.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The supplied power module is unfused. Power <strong>must</strong> be turned off while connecting peripherals.</p></div><p><img src="'+e+'" alt="quickstart"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The power module is not a power source for peripherals connected to the PWM outputs. 서보/액추에이터를 연결하는 경우에는 BEC를 사용하여 별도로 전원을 공급하여야 합니다.</p></div><h2 id="텔레메트리-선택-사항" tabindex="-1">텔레메트리(선택 사항) <a class="header-anchor" href="#텔레메트리-선택-사항" aria-label="Permalink to &quot;텔레메트리(선택 사항)&quot;">​</a></h2><p>지상국에서는 텔레메트리를 사용하여 기체를 통신, 모니터링, 제어 합니다. 기체를 특정 위치로 움직이도록 지시하거나, 새로운 임무를 업로드할 수 있습니다.</p><p>통신 채널은 텔레메트리를 통하여 이루어집니다. The vehicle-based radio should be connected to the <strong>TELEM1</strong> or <strong>TELEM2</strong> port (if connected to these ports, no further configuration is required). 다른 라디오는 지상국 컴퓨터 또는 모바일 장치에 USB를 통하여 연결합니다.</p><p><img src="'+n+'" alt="quickstart"></p><p><a id="sd_card"></a></p><h2 id="sd-카드-선택-사항" tabindex="-1">SD 카드(선택 사항) <a class="header-anchor" href="#sd-카드-선택-사항" aria-label="Permalink to &quot;SD 카드(선택 사항)&quot;">​</a></h2><p>An <a href="./../getting_started/px4_basic_concepts.html#sd-cards-removable-memory">SD card</a> is inserted in the factory (you do not need to do anything).</p><h2 id="모터" tabindex="-1">모터 <a class="header-anchor" href="#모터" aria-label="Permalink to &quot;모터&quot;">​</a></h2><p>Motors/servos are connected to the MAIN ports in the order specified for your vehicle in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><p><img src="'+e+'" alt="quickstart"></p><h2 id="핀배열" tabindex="-1">핀배열 <a class="header-anchor" href="#핀배열" aria-label="Permalink to &quot;핀배열&quot;">​</a></h2><p><img src="'+s+'" alt="V5 nano pinouts"></p><h2 id="추가-정보" tabindex="-1">추가 정보 <a class="header-anchor" href="#추가-정보" aria-label="Permalink to &quot;추가 정보&quot;">​</a></h2><ul><li><a href="./../frames_multicopter/dji_f450_cuav_5nano.html">Airframe buildlog using CUAV v5 nano on a DJI FlameWheel450</a></li><li><a href="./../flight_controller/cuav_v5_nano.html">CUAV V5 nano</a></li><li><a href="http://manual.cuav.net/V5-nano.pdf" target="_blank" rel="noreferrer">V5 nano manual</a> (CUAV)</li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a> (CUAV)</li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a> (CUAV)</li></ul>',47)]))}const x=c(u,[["render",m]]);export{P as __pageData,x as default};
